El Camino de Santiago me ha permitido disfrutar de paisajes y manjares de ensueño tan autóctonos como estos percebes. Galicia es un lugar extraordinario con una gastronomía riquísima que, además, también cuenta con una gran variedad de productos con el distintivo de Calidad Diferenciada de la UE.

#ElPaísMásRicoDelMundo

